import EventCard from "./EventCard";

function PastEventSection() {
  const pastEvent = [
    {
      id: 1,
      title: "Event 1",
      imageUrl:
        "https://i.ytimg.com/vi/SiW8P42C0Ck/maxresdefault.jpg",
    },
    {
      id: 2,
      title: "Event 2",
      imageUrl:
        "https://i.ytimg.com/vi/SiW8P42C0Ck/maxresdefault.jpg",
    },
    {
      id: 3,
      title: "Project 3",
      imageUrl:
        "https://i.ytimg.com/vi/SiW8P42C0Ck/maxresdefault.jpg",
    },
  ];
  return (
    <div className="container text-center my-5">
      <div className="row my-5 pt-3">
        {pastEvent.map((past) => (
          <div key={past.id} className="col-12 col-md-4 my-2">
            <EventCard project={project} />
          </div>
        ))}
      </div>
      <div className="my-5">
        <a href="/" className="text-dark text-right">
          <h5>
            See all events
            <i className="fas fa-arrow-right align-middle"></i>
          </h5>
        </a>
      </div>
    </div>
  );
}

export default PastEventSection;
